import React from "react";
import MyImage from "./assets/images/daphneheadshot.png"; // Adjust the path based on where the image is located

const Hero = () => (
    <div className="hero bg-[#f8cb74] p-10 flex flex-col md:flex-row items-center md:items-start text-[#090704]">
        {/* Image positioned on the left */}
        <img 
            src={MyImage} 
            alt="Headshot of Daphne" 
            className="w-1/3 md:w-1/4 h-auto mb-6 md:mb-0 md:mr-8"
        />
        {/* Text on the right */}
        <div className="text-left font-custom">
            <h1 className="text-4xl">Hey there!</h1>
            <p className="text-lg mt-4">I'm Daphne</p>
        </div>
    </div>
);

export default Hero;
